css:
.git-plus .alert {
  color: #ff982d;
}
.git-plus .success {
  color: #26c26a;
}
.git-plus .overlay.from-bottom {
  width: 600px;
}
.git-plus .info-view {
  overflow: auto;
}
.meta.diff.range.unified {
  color: #5293d8;
}
.meta.diff.header {
  color: #5293d8;
}
.markup.deleted.diff {
  color: #cc0000;
}
.markup.inserted.diff {
  color: #26c26a;
}
